import React, { Component } from 'react';
import { Col, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './../../node_modules/bootstrap/dist/css/bootstrap.css'
import './HeaderBar.css'

class HeaderBar extends Component {

  render() {
    return (
      <Navbar className="header-bar" style={{ width: "100vw" }}>
        <Col md={2} className="header-link">
          <Link to="/home/" >Home</Link>
        </Col>
        <Col md={2} className="header-link">
          <Link to="/about/" >Software</Link>
        </Col>
        <Col md={2} className="header-link">
          <Link to="/scheduler/" >Projects</Link>
        </Col>
        <Col md={2} className="header-link">
          <Link to="/scheduler/" >Fitness</Link>
        </Col>
        <Col md={2} className="header-link">
          <Link to="/scheduler/" >Travel</Link>
        </Col>
        <Col md={2} className="header-link">
          <Link to="/scheduler/" >Writing</Link>
        </Col>
        <Col md={12}>
          <h3> {this.props.title} </h3>
          <br/>
        </Col>
      </Navbar>
    );
  }
}

export default HeaderBar;
